import "antd/dist/antd.css";
import NetworkDrawer from "./Components/DrawerNetwork";
import NavigationMenu from "./Components/MenuNavigation";
import DeviceManagementApp from "./DeviceManagement";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <NavigationMenu />
      <DeviceManagementApp />
      <Router>
        <Routes>
          <Route path="/home" exact component={NetworkDrawer} />
          <Route path="/test" component={DeviceManagementApp} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
